import React,{Component} from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom';
import './HeaderBar.css';

class HeaderBar extends Component{
    render(){
        return(
            <header>
                <div className="title">
                    <h1>Victor Emerick</h1>
                    <h4>Site Pessoal</h4>
                </div>
                <nav>
                    <Link to="/">Início</Link>
                    <Link to="/curriculo">Currículo</Link>
                    <Link to="/portifolio">Portifólio</Link>
                    <Link to="/contato">Contato</Link>
                </nav>
                <div className="networks">
                    <p>Encontre-me</p>
                    <a href="https://www.facebook.com/victormachado.emerick1234" className="facebook" target="_blank"><i className="fab fa-facebook fa-2x"></i></a>
                    <a href="https://www.linkedin.com/in/victor-emerick/" className="linkedin" target="_blank"><i className="fab fa-linkedin fa-2x"></i></a>
                </div>
            </header>
        );
    }
}

export default HeaderBar;
